import React from "react";

class ChimForm extends React.Component{
    chim ={}
    constructor(props){
        super(props)
        this.state ={
            methane : 0,
            ethane: 0,
            propane: 0
        }
    }

    render(){
        return(
            <form method="post">
                <legend>Химические вещества</legend>
                <input placeholder="Температура С"type="number" min="273" max="1000" step="any"/>
                <legend>Состав в процентах</legend>
                <input placeholder="Метан" type="number" min="0" max="100" step="any"/>
                <input placeholder="Этан" type="number" min="0" max="100" step="any"/>
                <input placeholder="Пропан" type="number" min="0" max="100" step="any"/>
                <button type='button'>Результат?</button>
            </form>
        )}

}

export default ChimForm
